<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Menu</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <style>
      ::-webkit-scrollbar {
        width: 2px;
      }

      ::-webkit-scrollbar-thumb {
        background-color: #888;  
        border-radius: 2px;
      }

      ::-webkit-scrollbar-thumb:hover {
        background-color: #555;  
      }
      #categories {
        display: flex;
        flex-wrap: wrap;
        max-width: 100vw;
      }
      .category {
        cursor: pointer;
        font-size: 1.2em;
        padding: 0.5em 1em;
        border: 1px solid rgb(0, 89, 167);
        border-radius: 5000px;
        color: rgb(0, 89, 167);
        transition: all 300ms linear;
        margin: 5px;
      }
      .category.active {
        background: rgb(0, 89, 167);
        color: white;
      }
      footer{
        position: fixed;
        bottom: 0;
        left: 0;
        width: 100%;
        color:#eee;
        background: linear-gradient(to right, rgb(0,89,167), rgb(7, 51, 89));
        text-align: center;
        box-sizing: border-box;
        padding: 10px;
      }
    </style>
  </head>
  <body class="container mx-auto">
    <div>
      <div class="grid grid-cols-3">
        <div class="col-span-3 md:col-span-1 flex justify-center md:block">
          <img id="logo_img" src="" alt="" class="h-24" />
        </div>
        <div
          class="col-span-3 md:col-span-2 px-4 md:flex md:flex-row-reverse justify-center items-end"
        >
          <div class="md:w-1/2 md:ml-4">
            <label
              for="sort"
              class="block text-xs font-medium leading-6 text-gray-700"
              >Sort By</label
            >
            <select
              id="sort"
              name="sort"
              onchange="setItems()"
              class="block w-full rounded-md p-2 text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:border-indigo-700"
            >
              <option value="name">Name</option>
              <option selected value="desc">Desc</option>
              <option value="qty">QTY</option>
              <option value="price">Price</option>
            </select>
          </div>
          <div class="flex-1 mt-4 md:w-1/2">
            <label
              for="default-search"
              class="mb-2 text-sm font-medium text-gray-900 sr-only"
              >Search
            </label>
            <div class="relative">
              <div
                class="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none"
              >
                <svg
                  class="w-4 h-4 text-gray-500 dark:text-gray-400"
                  aria-hidden="true"
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 20 20"
                >
                  <path
                    stroke="currentColor"
                    stroke-linecap="round"
                    stroke-linejoin="round"
                    stroke-width="2"
                    d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"
                  />
                </svg>
              </div>
              <input
                type="search"
                id="search"
                onkeyup="setItems()"
                class="block w-full p-2 pl-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:border-indigo-700"
                placeholder="Search"
                required
              />
            </div>
          </div>
        </div>
      </div>
      <div
        id="categories"
        class="my-2 p-2 bg-gray-50 space-x-2 flex text-sm font-bold"
      >
      <span class="category active" data-value="" onclick="changeCategory(this);">All</span>
    </div>
      <div class="divider divide-y-2 px-4 pb-10">
        <ul
          role="list"
          id="menu_items"
          class="divide-y md:divide-y-0 divide-gray-100 md:grid grid-cols-12 gap-3"
        >
          
        </ul>
      </div>
    </div>

        <span>Want your own E-Price list?</span>

    </footer>

LAGAAAAAAAAAAAAGEBhDQAAAAAAAAAAADCAwhoAAAAAAAAAAABgAIU1AAAAAAAAAAAAwAAKawAAAAAAAAAAAIABFNYAAAAAAAAAAAAAAyisAQAAAAAAAAAAAAZQWAMAAAAAAAAAAAAMoLAGAAAAAAAAAAAAGEBhDQAAAAAAAAAAADCAwhoAAAAAAAAAAABgAIU1AAAAAAAAAAAAwAAKawAAAAAAAAAAAIABFNYAAAAAAAAAAAAAAyisAQAAAAAAAAAAAAZQWAMAAAAAAAAAAAAMoLAGAAAAAAAAAAAAGEBhDQAAAAAAAAAAADCAwhoAAAAAAAAAAABgAIU1AAAAAAAAAAAAwAAKawAAAAAAAAAAAIABFNYAAAAAAAAAAAAAAyisAQAAAAAAAAAAAAZQWAMAAAAAAAAAAAAMoLAGAAAAAAAAAAAAGEBhDQAAAAAAAAAAADCAwhoAAAAAAAAAAABgAIU1AAAAAAAAAAAAwAAKawAAAAAAAAAAAIABFNYAAAAAAAAAAAAAAyisAQAAAAAAAAAAAAZQWAMAAAAAAAAAAAAMoLAGAAAAAAAAAAAAGEBhDQAAAAAAAAAAADCAwhoAAAAAAAAAAABgAIU1AAAAAAAAAAAAwAAKawAAAAAAAAAAAIAB\/x9QEig9fx4wqQAAAABJRU5ErkJggg==");
        setCategory();
        setItems();
      };

      const setCategory = () => {
        const $category = $("#categories");

        const { categories } = data;
        categories.forEach((name) => {
          let active = "";
          if (name === "") {
            active = " active";
          }
          const $option = $(
            `<span class="category${active}" data-value="${name}" onclick="changeCategory(this);">${name}</span>`
          );
          $category.append($option);
        });
      };
      function changeCategory(el) {
        Array.from(document.getElementsByClassName('category')).forEach((category) => {
          category.classList.remove("active");
        });
        el.classList.add("active");
        selected_category = el.dataset.value;
        setItems();
      }
      const setItems = () => {
        const $sort = $("#sort");
        const selected_sort = $sort.val();

        const $menu_items = $("#menu_items");
        $menu_items.empty();

        const search_text = $("#search").val().toLowerCase();
        const { categories, menu_items, settings } = data;

        const category_list = selected_category
          ? [selected_category]
          : categories;

        const menu = {};

        category_list.forEach((category) => {
          menu_items.forEach((item) => {
            const { name, price, image, qty, category: item_category } = item;
            if (category !== item_category) {
              return;
            }

            if (
              search_text &&
              name.toLowerCase().indexOf(search_text) === -1 &&
              search_text &&
              item.description.toLowerCase().indexOf(search_text) === -1
            ) {
              return;
            }

            if (!menu[category]) {
              menu[category] = [item];
            } else {
              menu[category].push(item);
            }
          });
        });

        category_list.forEach((category, i) => {
          const items = menu[category];
          if (!items) {
            return;
          }

          const $category = $(`<li class="pt-6 sticky col-span-12">
                                 <h3 id="cat_${i}" class="text-lg font-medium leading-6 text-gray-900"></h3>
                               </li>`);
          $menu_items.append($category);
          $(`#cat_${i}`).text(category);
          // sort items
          items.sort((a, b) => {
            if (selected_sort === "name") {
              return a.name.localeCompare(b.name);
            } else if (selected_sort === "desc") {
              return a.description.localeCompare(b.description);
            } else if (selected_sort === "qty") {
              return b.qty - a.qty;
            } else if (selected_sort === "price") {
              return a.price - b.price;
            }
          });

          items.forEach((item, j) => {
            const { id, name, price, image, category, description, qty } = item;
            
            const $item = $(`
              <li class="md:col-span-6 lg:col-span-4 h-full">
                <a href="https://api.whatsapp.com/send?phone=${
                  settings.phoneNumber
                }&text=I%20want%20to%20order%20${name}%20${description}${price}" target="_blank">
      
                <div class="h-full flex items-stretch md:border border-gray-200 md:rounded-md p-2 justify-between gap-x-6 py-3">
                    <div class="flex-1">
                      <p id="item_name${id}" class="text-base font-semibold leading-6 text-gray-800"></p>
                      <p id="item_price${id}" class="mt-1 truncate text-sm leading-5 text-gray-500"></p>
                      <p id="item_qty${id}" class="mt-1 truncate text-sm leading-5 text-gray-500"></p>
                      <p id="item_description${id}" class="mt-1 overflow-hidden whitespace-normal text-xs leading-5 text-gray-500"></p>
                    </div>
                    <div>
                      ${
                        image &&
                        `<img
                            class="h-16 md:h-20 w-16 md:w-20 bg-gray-50 rounded-lg"
                            style="object-fit: contain;"
                            id="item_image${id}"
                          />`
                      }
                    </div>
                </div>
                </a>
              </li>
            `);
            $menu_items.append($item);
            $(`#item_name${id}`).text(name);
            $(`#item_price${id}`).text(`${settings.currency}${price}`);
            $(`#item_qty${id}`).text(`Qty: ${qty}`);

            $(`#item_image${id}`).attr("src", image);
            $(`#item_image${id}`).attr("alt", name);

            if (String(description).length > 80) {
              $(`#item_description${id}`).text(
                String(description).substring(0, 80) + "..."
              );

              const $more = $(
                `<button class="text-xs text-gray-700 hover:text-gray-900" onclick="expandItem('${id}')">More</button>`
              );
              $(`#item_description${id}`).append($more);
            } else {
              $(`#item_description${id}`).text(String(description));
            }
          });
        });
      };

      const expandItem = (id) => {
        const { categories, menu_items } = data;
        const item = menu_items.find((item) => item.id === id);
        const { description } = item;
        $(`#item_description${id}`).text(description);
      };

      init();
    </script>
  </body>
